import { useCroct } from '@croct/plug-react';
import React, {useState} from 'react';
import {Link} from 'react-router-dom'

function Inicio (){
   const croct = useCroct();
   const [count, setCount] = useState(0);
   if (count == 1){
    croct.user.edit().unset('custom.persona').save();
   }
   
return (
  <div id="Page">
        <div id="titulo">
          <h1>Seja bem-vindo a Croct!</h1> 
        </div>
        <div id="introdution">
          <p>Dentre as opções abaixo, qual você mais se identifica?</p>
          <Link to="/developer">
             <button onClick={() => setCount(count + 1)}>Developer</button>
          </Link>
          <Link to="/marketer">
             <button  onClick={() => this.setState({ count: this.state.count + 1 })}>Marketer</button>
          </Link>
          <Link to="/hacker">
             <button  onClick={() => this.setState({ count: this.state.count + 1 })}>Growth-Hackers</button>
          </Link>
    </div>
   </div>
)}

export default Inicio;
